*{box-sizing: border-box;margin:0;padding: 0;}
*::before{box-sizing: border-box;}
*::after{box-sizing: border-box;}
#buttons{
    position: fixed;
    right:0;
    top: 0;
    z-index: 15;
    display: flex;
    flex-direction: column;
    margin-top: 10px;
    margin-right: 10px;
}
#buttons>button{
    margin-bottom: 10px;
    padding: 4px 8px;
}
#demo2{
    display: none;
}
#demo{
    position: fixed;
    top: 0;
    left:0;
    width: 100%;
    height: 40vh;
    border: 1px solid #ffe600;
    overflow-y: auto;
}
#demo::-webkit-scrollbar {
    display: none;
}
#html{
    position: fixed;
    bottom: 0;
    left:0;
    width: 100%;
    height: 60vh;
}
body{
    overflow: hidden;
}
.skin{
    position: relative;
}
@keyframes leftWave {
    0%{
        transform: translateX(-95px) rotate(160deg)
    }
    50%{
        transform: translateX(-95px) rotate(152deg)
    }
    100%{
        transform: translateX(-95px) rotate(160deg)
    }
}
@keyframes rightWave {
    0%{
        transform: translateX(95px) rotate(200deg)
    }
    50%{
        transform: translateX(95px) rotate(208deg)
    }
    100%{
        transform: translateX(95px) rotate(200deg)
    }
}
